message:
chore: remove unused babel plugins and presets

**Added**

This was added instead of `@babel/preset-flow` because was used explicit
in babel config.
`@babel/preset-flow` didn't have any value

```
@babel/plugin-transform-flow-strip-types
```

**Included in
[`@babel/preset-env`](https://github.com/babel/babel/blob/cab1e79ba706249876a41f88d288e7c1c0bea673/packages/babel-preset-env/package.json)**

```
@babel/plugin-proposal-json-strings
@babel/plugin-proposal-numeric-separator
@babel/plugin-syntax-dynamic-import
@babel/plugin-transform-modules-commonjs
```

**Included in
[`@babel/preset-react`](https://github.com/babel/babel/blob/d3cf5fb5f4b46a1f7e9e33f2d24a466e3ea1e50f/packages/babel-preset-react/package.json)**

```
@babel/plugin-transform-react-jsx-source
```

**Included in `@babel/plugin-transform-runtime` (manual tested)**

```
@babel/plugin-transform-regenerator
babel-plugin-syntax-async-functions
```

**Banned by flow-type, or unused (some under flag)**

```
@babel/plugin-proposal-decorators
@babel/plugin-proposal-export-namespace-from
@babel/plugin-proposal-throw-expressions
```

**Unused plugins**

```
@babel/plugin-proposal-function-sent
@babel/plugin-syntax-import-meta
@babel/register
babel-preset-es2015-no-commonjs
```
